import React, {Component} from 'react';

import AboutNavBar from './components/AboutNavBar';

import './../../css/Selab.scss';

const pageTrans = 'trans-s'
const classNames = {
  appear: `${pageTrans} appear`,
  appearActive: `${pageTrans} appear active`,
  appearDone: `${pageTrans} appear done`,
  enter: `${pageTrans} enter`,
  enterActive: `${pageTrans} enter active`,
  enterDone: `${pageTrans} enter done`,
  exit: `${pageTrans} exit`,
  exitActive: `${pageTrans} exit active`,
  exitDone: `${pageTrans} exit done`
}


class Selab extends Component {
  constructor(props) {
    super(props);

    this.state = {
      location: ['MemberTest', 'ResearchTest', 'PublicationsTest', 'ContactTest'],
      index: 0
    };

    this.changeLocation = this.changeLocation.bind(this);
  }

  // state index를 변경해서 렌더링 되는 페이지를 바꿀 것
  changeLocation(nextindex) {
    console.log(nextindex);
    this.setState({index: nextindex});
  }

  changeContent() {
    console.log('----');
    const name = this.state.location[this.state.index];
    console.log(name);
    console.log(typeof(name));
    var current = document.getElementsByClassName('LabTestcurrent');
    var el2 = document.getElementById(name);
    console.log(current);
    console.log(el2);
    current.innerHTML = el2.innerHTML;
  }

  //메인 화면
  render() {
    this.changeContent();
    return(
        <div className="Contents-page2">
          <AboutNavBar
          onChangeLocation={this.changeLocation}/>
          <div className="Lab-contents">
            <div className="LabTestCurrent">
              {/*건들지마요*/}
              <p>Test</p>
            </div>
            <div id="MemberTest" style={{display: 'none'}}>
              <p>멤버</p>
            </div>
            <div id="ResearchTest" style={{display: 'none'}}>
              <p>연구</p>
            </div>
            <div id="PublicationsTest" style={{display: 'none'}}>
              <p>출판</p>
            </div>
            <div id="ContactTest" style={{display: 'none'}}>
              <p>연락</p>
            </div>
          </div>
        </div>
    );
  }
}

export default Selab;
